_ENABLESHADOW_ON

#version 100

uniform 	vec4 hlslcc_mtx4x4unity_ObjectToWorld[4];
uniform 	vec4 hlslcc_mtx4x4unity_MatrixVP[4];
uniform 	mediump float _ShadowHeight;
uniform 	mediump vec4 _LightDirection;
attribute highp vec4 in_POSITION0;
vec4 u_xlat0;
vec4 u_xlat1;
float u_xlat2;
float u_xlat6;
void main()
{
    u_xlat0.xyz = in_POSITION0.yyy * hlslcc_mtx4x4unity_ObjectToWorld[1].xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[0].xyz * in_POSITION0.xxx + u_xlat0.xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[2].xyz * in_POSITION0.zzz + u_xlat0.xyz;
    u_xlat0.xyz = hlslcc_mtx4x4unity_ObjectToWorld[3].xyz * in_POSITION0.www + u_xlat0.xyz;
    u_xlat6 = hlslcc_mtx4x4unity_ObjectToWorld[3].y + _ShadowHeight;
    u_xlat2 = (-u_xlat6) + u_xlat0.y;
    u_xlat6 = u_xlat6 + _ShadowHeight;
    u_xlat1 = vec4(u_xlat6) * hlslcc_mtx4x4unity_MatrixVP[1];
    u_xlat2 = u_xlat2 / (-_LightDirection.y);
    u_xlat0.xy = _LightDirection.xz * vec2(u_xlat2) + u_xlat0.xz;
    u_xlat1 = hlslcc_mtx4x4unity_MatrixVP[0] * u_xlat0.xxxx + u_xlat1;
    u_xlat0 = hlslcc_mtx4x4unity_MatrixVP[2] * u_xlat0.yyyy + u_xlat1;
    gl_Position = u_xlat0 + hlslcc_mtx4x4unity_MatrixVP[3];
    return;
}


